import React, { Component } from 'react'
import Display from './Display';


export default class PrintType extends Component{
    render(){

  const selectOptions = this.props.selectOptions;
  const printOptions = printOptions.PrintType.map((options, i) => (
   <options value={options} key={i}> 
    {options}
  </options>  
  )); 

    return (
        <div>
          <Display 

          bookOptions={printOptions}
          printOnChange={this.printOnChange}

          />
        </div>

    );
  }
}
